  selector: 'app-dialog-confirm-example',
  standalone: true,
  imports: [CommonModule, C3DialogModule, MatButtonModule],
  templateUrl: './dialog-confirm-example.component.html',
  styleUrl: './dialog-confirm-example.component.scss',
